import React from 'react';
import './home.css';
import img2 from '../../assets/img2.jpg'; // Make sure to include the correct file extension (.jpg, .png, etc.)

const Home = () => {
  return (
    <div className="home-container" style={{ backgroundImage: `url(${img2})` }}>
      <div className="content">
        <button className="participate-btn">Participate in Fest</button>
        <button className="organize-btn">Organize a Fest</button>
      </div>
    </div>
  );
};

export default Home;
